import { Box, Container, Grid, Paper, Typography } from '@mui/material'
import { withStyles } from '@mui/styles'
import React from 'react'

const styles = {
    mainGridClass:{
        backgroundColor:'lightBlue',
        padding:'20px',
        borderRadius:'50px',
        display:'flex',
        alignItems:'center',
        justifyContent: 'center'
    },
    innerBoxClass1:{
        borderLeft: "40px solid transparent",
        borderRight: "40px solid transparent",
        borderBottom: "80px solid lightblue",
        backgroundColor:'orange'
    },
    innerBoxClass2:{
        padding:'20px'
    },
    innerBoxClass3:{
        padding:'20px'
    },
    innerBoxClass4:{
        padding:'20px'
    }
}


function ProfileComponent(props) {
    const {classes} = props;
  return (
    <>  <Paper>
        <Container>
        <Grid className={classes.mainGridClass}>
            <Box className={classes.innerBoxClass1}>
                <Typography>Click here to view Profile</Typography>
            </Box>
            <Box className={classes.innerBoxClass2}>
                <Typography>Click here to view Education</Typography>
            </Box>
            <Box className={classes.innerBoxClass3}>
                <Typography>Click here to view Experience</Typography>
            </Box>
            <Box className={classes.innerBoxClass4}>
                <Typography>Click here to view Skills</Typography>
            </Box>
            </Grid></Container>
        </Paper>
    </>
  )
}
export default withStyles(styles) (ProfileComponent)
